&lt;p&gt;NerdVsWorld is a podcast from three thirtysomething nerds from Oxford: Brendan, Spindles and Ady. It is the amalgamation of Brendan&#039;s NerdVsWorld youtube show and Si and Ady&#039;s Eclectic Technicolour Podcast of Awesome.
