UNC-TV’s North Carolina Bookwatch is the state’s premier literary series, bringing the Tar Heel State’s best and brightest Southern writers to the small screen. In every illuminating interview, host D.G. Martin sheds light on authors’ lives, books and the state’s indelible imprint on their works.&lt;br&gt;
&lt;br&gt;
D.G. Martin has hosted North Carolina Bookwatch since the series’ third season in 1999. A Yale Law School graduate and former Green Beret, Martin has been involved with public service, and politics throughout his life, including stints as interim Vice Chancellor for Development and University Affairs at both UNC-Pembroke and North Carolina Central University, work as the Carolinas Director of the Trust for Public Land, and a hard-fought 1998 campaign for the Democratic nomination to the U.S. Senate against John Edwards. &lt;br&gt;

