In a world where we're bombarded with celebrity nip slips and news of warrantless spying with equal ferocity, Nothing Urgent tames the zeitgeist for you the only way hosts Derek Evers and Chris Robbins know how: probing interviews, pleasant conversation, and the occasional fart joke. Awarded the Peabody Institute's prestigious Mullet Award in 2011, Nothing Urgent is half-news, half-music, all-culture. Listen, you might learn something. &#xD;
&#xD;
Derek Evers is the founder and publisher of Impose Magazine and a regular contributor to Golf Digest. His writing resume includes Vice, Fader, Gothamist, AOL, Village Voice, and he enjoyed a short stint as a talking head on VH1's Most Shocking Moments in Music. He loves ginger ale.&#xD;
&#xD;
Chris Robbins writes about New York City for the website Gothamist. He once asked the police commissioner about his favorite Applebee's menu item, covered an intergalactic tribunal against mankind, and is fascinated by electronic cigarettes. He lives in Manhattan with his cactus, Victor.

