Avec Richard GAITET&#xD;
Lundi-Jeudi 22H00-24H00&#xD;
Branchez-vous sur le juke-box littéraire de Radio Nova. Une machine à lire qui balance des morceaux de littérature aussi variés, exigeants et inattendus que la playlist musicale de la station… En deux heures, Nova donne à entendre des extraits de romans, mais aussi des bouts d’essais, des fragments de nouvelles, de la poésie, de la prose, du classique comme de la nouveauté, des rééditions ou des manuscrits pas encore publiés, des bizarreries et de la BD, Borges ou Bukowski, Sartre ou San-Antonio, James Ellroy aussi bien que Barbara Cartland, Pléiade ou Harlequin, de l’érotique, des contes pour enfants, des biographies de stars comme des programmes politiques, des livres de cuisine comme des manuels de savoir-vivre…

