Segundo Informe sobre Democracia en América Latina&#13;
&#13;
Informe realizado por el Programa de las Naciones Unidas para el Desarrollo y la Organización de los Estados Americanos&#13;
El PNUD realizó una alianza con la Asociación Latinoamericana de Educación Radiofónica (ALER) para difundir y debatir sobre los temas que plantea el Informe “Nuestra Democracia”, a través de 13 programas radiales que serán transmitidos a toda la red de ALER.&#13;
ALER es una entidad regional que agrupa a 107 radios comunitarias, populares y educativas en 11 países de América Latina y El Caribe.&#13;
Los programas radiales serán transmitidos en vivo en las fechas que se indica en el recuadro a las 8.30 am hora Nueva York. Una vez transmitidos estarán disponibles en esta página web haciendo clic en el nombre del programa.&#13;
También le invitamos a escuchar el material de la campaña de difusión (cuñas radiofónicas y microprogramas).
